		function Ruido_Gaus(media, desviS) {
			var r1 = Math.random();
			var r2 = Math.random();
			var z0 = Escalar_Gauseano * Math.sqrt(-2.0 * Math.log(r1)) * Math.cos(2 * Math.PI * r2);
			return z0 * desviS + media;
		}
		// Función para remuestrear la señal 
		function resampleSignal(signal, targetFrequency) {
			const sourceFrequency = 50; // Frecuencia de la señal de origen (50 Hz en este caso)
			const factor = sourceFrequency / targetFrequency; // Factor de re muestreo
			const resampledSignal = [];

			for (let i = 0; i < signal.length; i += factor) {
				const startIndex = Math.floor(i); // Índice inferior de la interpolación
				const endIndex = Math.ceil(i); // Índice superior de la interpolación
				const startValue = signal[startIndex]; // Valor de la señal en el índice inferior
				const endValue = signal[endIndex]; // Valor de la señal en el índice superior
				const fractionalIndex = i - startIndex; // Fracción entre los índices
				const interpolatedValue = startValue + (endValue - startValue) * fractionalIndex; // Valor interpolado
				resampledSignal.push(interpolatedValue); // Agregar el valor interpolado al arreglo de la señal remuestreada
			}

			return resampledSignal; // Devolver la señal remuestreada
		}

		//Constantes para el modelo MCK
		function ConsMDI() {
			a1 = (4 * m / (dt * dt)) + (2 * c / (dt));
			a2 = (4 / (dt)) * m + c;
			a3 = m;
			kj = k + a1;
		}
		//Constantes para el modelo Zeta Wn
		function ConsWnZe() {
			a1 = (4 / (dt * dt)) + (2 * 2 * zeta * Wna / (dt));
			a2 = (4 / (dt)) + 2 * zeta * Wna;
			a3 = 1;
			kj = Wna * Wna + a1;
		}

		//Movimiento Sinusoildal MCK
		function contador() {
			var contador1 = 0;
			var t = 0;
			contadorglobal = 0;
			p1[0] = 0;
			function Senoiterativo() {
				Vtiempo[contador1] = contador1;
				switch (validador3) {
					case 1:
						Seno[contador1] = Po * Math.sin(Wn * t); //Desplazamiento en la base
						if (validador == 0) {
							p[contador1] = (Wn * Wn) * m * Seno[contador1]; //Aceleración en el grado de libertad debido al desplazamiento
							p1[contador1] = (Wn * Wn) * m * Po * Math.sin(Wn * (t + dt)); //P+1
						} else {
							p[contador1] = (Wn * Wn) * Seno[contador1]; //Aceleración en el grado de libertad debido al desplazamiento
							p1[contador1] = (Wn * Wn) * Po * Math.sin(Wn * (t + dt)); //P+1
						}
						break;
					case 2:
						Wv[contador1 + 1] = Wv[contador1] + Vel;
						Seno[contador1] = Po * Math.sin(Wv[contador1] * t); //Desplazamiento en la base
						if (validador == 0) {
							p[contador1] = (Wv[contador1] * Wv[contador1]) * m * Seno[contador1]; //Aceleración en el grado de libertad debido al desplazamiento
							p1[contador1] = ((Wv[contador1] * Wv[contador1])) * m * Po * Math.sin(Wv[contador1] * (t + dt)); //P+1
						} else {
							p[contador1] = ((Wv[contador1] * Wv[contador1])) * Seno[contador1]; //Aceleración en el grado de libertad debido al desplazamiento
							p1[contador1] = ((Wv[contador1] * Wv[contador1])) * Po * Math.sin((Wv[contador1]) * (t + dt)); //P+1
						}
						break;
					default:
						alert("Desconozco estos valores");
				}
				//   p1[contador1]=Po*Math.sin(Wn*(t+dt)); Para probar el método
				//   p[contador1]=Seno[contador1]; // Para probar el método
				P[contador1] = 0;
				//   Mesa1.position.z=Seno[contador1] //Posición z de la mesa
				Mesa1.position.x = Seno[contador1] + 5 //Posición x de la mesa
				SensorB.position.x = Seno[contador1] + 6.954; //Sensor en la Base
				//Mover la Barra
				// Barra11.position.x = Seno[contador1] + 5 //Posición barra en x
				//   console.log(u[contador1]);
				Vtiempo2[contador1] = t;
				contador1++;
				contadorglobal2++;
				t = t + dt;
				t1 = t1 + dt;
				//console.log(Vtiempo);
				//console.log(Mesa1.position.y);
				renderer.render(scene, camera);
				switch (validador3) {
					case 1:
						if (contador1 >= (Segundos * 120 + 1)) {
							clearInterval(tiempo1);
						}
						break;
					case 2:
						if (t1 >= (IntervaloB)) {
							console.log('Entro')
							clearInterval(tiempo1);
						}
						break;
					default:
						alert("Desconozco estos valores");
				}

			for (let i = 0; i < positionAttribute.count; i++) {
				const x = positionAttribute.getX(i);
				const y = positionAttribute.getY(i);
				const z = positionAttribute.getZ(i);
				spherePositions.push(
					x * Math.sqrt(1 - (y * y / 2) - (z * z / 2) + (y * y * z * z / 3)),
					y * Math.sqrt(1 - (z * z / 2) - (x * x / 2) + (z * z * x * x / 3)),
					z * Math.sqrt(1 - (x * x / 2) - (y * y / 2) + (x * x * y * y / 3))
				);
				vertex.set(x * 2, y, z);
				vertex.applyAxisAngle(direction, Math.PI * x / 2).toArray(twistPositions, twistPositions.length);
			}
			geometry.morphAttributes.position[0] = new THREE.Float32BufferAttribute(spherePositions, 3);
			geometry.morphAttributes.position[1] = new THREE.Float32BufferAttribute(twistPositions, 3);
			return geometry;
		}

		//Exportar Datos a excel
		function convertToCSV(objArray) {
			var array = typeof objArray != 'object' ? JSON.parse(objArray) : objArray;
			var str = '';

			for (var i = 0; i < array.length; i++) {
				var line = '';
				for (var index in array[i]) {
					if (line != '') line += ','

					if (array[i][index] != null) {
						line += array[i][index];
					} else {
						line += ''
					}
				}

				str += line + '\r\n';
			}

			return str;
		}
		function exportCSVFile(headers, items, fileName) {
			if (headers) {
				items.unshift(headers);
			}

			const jsonObject = JSON.stringify(items);

			const csv = convertToCSV(jsonObject);

			const exportName = fileName + ".csv" || "export.csv";

			const blob = new Blob([csv], { type: "text/csv;charset=utf-8;" });
			if (navigator.msSaveBlob) {
				navigator.msSaveBlob(blob, exportName);
			} else {
				const link = document.createElement("a");
				if (link.download !== undefined) {
					const url = URL.createObjectURL(blob);
					link.setAttribute("href", url);
					link.setAttribute("download", exportName);
					link.style.visibility = "hidden";
					document.body.appendChild(link);
					link.click();
					document.body.removeChild(link);
				}
			}
		}
